const uppercaseChars = "ABCDEFGHIJKLMNOPQRSTUVWXYZ";
const lowercaseChars = "abcdefghijklmnopqrstuvwxyz";
const numberChars = "0123456789";
const specialChars = "!@#$%^&*()_+[]{}|;:,.<>?";
const ambiguousChars = "1lIoO0";

try {
  const options = {
    includeUppercase: getComponentValue("checkbox1", "Include Uppercase"),
    includeLowercase: getComponentValue("checkbox2", "Include Lowercase"),
    includeNumbers: getComponentValue("checkbox3", "Include Numbers"),
    includeSpecial: getComponentValue(
      "checkbox4",
      "Include Special Characters"
    ),
    avoidAmbiguous: getComponentValue(
      "checkbox5",
      "Avoid Ambiguous Characters"
    ),
    passwordLength:
      parseInt(getComponentValue("numberInput1", "Password Length")) || 8,
  };

  let possibleChars = "";

  if (options.includeUppercase) possibleChars += uppercaseChars;
  if (options.includeLowercase) possibleChars += lowercaseChars;
  if (options.includeNumbers) possibleChars += numberChars;
  if (options.includeSpecial) possibleChars += specialChars;

  if (options.avoidAmbiguous) {
    possibleChars = possibleChars.replace(
      new RegExp(`[${ambiguousChars}]`, "g"),
      ""
    );
  }

  if (possibleChars.length === 0) {
    actions.showAlert("Please select at least one character type!", "error");
    return;
  }

  let password = "";
  for (let i = 0; i < options.passwordLength; i++) {
    const randomIndex = Math.floor(Math.random() * possibleChars.length);
    password += possibleChars[randomIndex];
  }

  if (components.text1) {
    components.text1.setText(password);
  } else {
    actions.showAlert("Error: Unable to display password", "error");
  }
} catch (error) {
  actions.showAlert(`Error generating password: ${error.message}`, "error");
}

function getComponentValue(componentName, description) {
  if (components[componentName]) {
    return components[componentName].value;
  } else {
    actions.showAlert(`Component ${description} not found`, "warning");
  }
}

const password = components.text1.text;
if (password) {
  actions.copyToClipboard(password);
  actions.showAlert("Password copied to clipboard!", "success");
} else {
  actions.showAlert("No password to copy.", "warning");
}
